import { Link } from 'react-router-dom';
import './Home.css';

function Home() {
  return (
    <div className="Home">
      <h1>Home </h1>

      <a href="/SignUp"> aaa </a>
      <br /><br />

      <a href="/404"> aaa </a>
      <br /><br />

      <a href="/User"> aaa </a>
      <br /><br />

      <a href="/Bank"> aaa </a>
      <br /><br />

      <a href="/LogIn"> aaa </a>
      <br /><br />

      <a href="/Transaction"> aaa </a>
      <br /><br />
      

          <Route path="/SignUp" element={<SignUp />} />
          <Route path="/" element={<Transaction />} />
          <Route path="/TransactionD" element={<TransactionDetail />} />

    </div>
  );
}

export default Home;
